import React from 'react';
import './App.css';
import Home from "./pages/home"
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Projects from "./pages/projects";
import Card from "./components/card.js"


/*
 Projects sayfasını tamamla
 home ve projects linklerini bağla
 href props ve state kullanımı
 */

function App() {

    var sectionStyle = {
        width: "100%",
        height: "400px"
    };

    const textStyle = {
        color : "#34A4EB",
        fontSize : "16px"
    };
    return (
        <div className="App bg" style={sectionStyle}>

            <Navbar bg="dark" expand="lg">
                <Navbar.Brand href="/home" className="ml-2" style={{color: "#34A4EB",fontSize: "20px"}}>Alper Tunca</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav mr-1" style={{backgroundColor:"#34A4EB"}}/>
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto mr-2" >
                        <Nav.Link href="/home" style={textStyle}>Home</Nav.Link>
                        <Nav.Link href="/projects" style={textStyle}>Projects</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

            <Card/>
            <Home/>
            <Projects/>

        </div>
    );
}

export default App;
